import React from "react";
import "../assets/styles.css";
import "../assets/home-dark.css";

import logoNuevo from "../assets/img/logonuevo.png";
import lootroomTextLogo from "../assets/img/lootroomlogo.png";
import syvarLogo from "../assets/img/syvarlogo.png";
import rustypotTextLogo from "../assets/img/rustypotlogo.png";

export default function Home() {
  React.useEffect(() => {
    document.body.classList.add("has-video-bg");
    return () => document.body.classList.remove("has-video-bg");
  }, []);

  return (
    <div className="home-dark has-video-bg">
      <main
        className="home-hero"
        style={{
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          justifyContent: "center",
          gap: "1.4rem",
        }}
      >
        <img className="home-hero-logo" src={logoNuevo} alt="Rustaco" />
        <p
          style={{
            margin: 0,
            fontSize: "1.45rem",
            fontWeight: 800,
            letterSpacing: "6px",
            textTransform: "uppercase",
            color: "#ffffffd0",
            textShadow: "0 6px 26px rgba(0,0,0,0.8)",
          }}
        >
          Soon..
        </p>
      </main>

      <footer
        style={{
          position: "relative",
          zIndex: 20,
          padding: "1.4rem 1.2rem 2.2rem",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          gap: 28,
          background:
            "linear-gradient(90deg, rgba(8,8,10,0.7), rgba(0,0,0,0))",
        }}
      >
        <img
          src={syvarLogo}
          alt="Syvar"
          style={{ width: 140, height: "auto", objectFit: "contain" }}
        />
        <img
          src={lootroomTextLogo}
          alt="Lootroom"
          style={{ width: 160, height: "auto", objectFit: "contain" }}
        />
        <img
          src={rustypotTextLogo}
          alt="Rustypot"
          style={{ width: 140, height: "auto", objectFit: "contain" }}
        />
      </footer>
    </div>
  );
}
